import React from 'react';
import { Link } from 'react-router-dom'
import './Navbar.scss';

class Navbar extends React.Component {
    render() {
    if (window.innerWidth >= 900) {
        return(
            <div className = "container">
                <div className="mobile-nav" onClick = {this.props.openNav}>
                    <div className="bar1"></div>
                    <div className="bar2"></div>
                    <div className="bar3"></div>
                </div>

                {this.props.isAuth
                ?
                <div id="mySidenav" className="sidenav">

                    <Link to='/dashboard' onClick={this.props.openNav}>Dashboard <i className="fas fa-home"></i></Link>
                    <Link to="/documents" onClick={this.props.openNav}>Documents <i className="fas fa-file"></i></Link>
                    <Link to="/inbox" onClick={this.props.openNav}>Messages <i className="fas fa-envelope"></i></Link>
                    <Link to="/profile" onClick={this.props.openNav}>Profile <i className="fas fa-user"></i></Link>
                    {/* <Link to="/store" onClick={this.props.openNav}>Store</Link> */}
                    <Link to = '#' onClick={this.props.logoutHandle}>Sign Out <i className="fas fa-sign-out-alt"></i></Link>
                </div>
                :
                <div id="mySidenav" className="sidenav">

                    <Link to="/" onClick={this.props.openNav}>Overview <i className="fa fa-home" aria-hidden="true"></i></Link>
                    <Link to="/pricing" onClick={this.props.openNav}>Pricing <i className="fas fa-dollar-sign"></i></Link>
                    <Link to="#">Product <img src={logo2} alt="LC"id="logo-menu"/></Link>
                    <Link to="#" onClick={this.props.openNav}>Contact <i className="far fa-envelope"></i></Link>
                    <Link to="/login" onClick={this.props.openNav}>Login <i className="fas fa-sign-in-alt"></i></Link>
                </div>
                }
                </div>
            )
        }
    }
}

export default Navbar;
